import React, { Component } from "react";

export default class HomePage extends Component {
  render() {
    return (
      <div class="container">
        <div class="row">
          <div class="col-9">
            <div class="title" style={{ textAlign: "left" }}>
              <span class="material-symbols-outlined">star</span>
              Danh Sách Truyện
            </div>
          </div>
          <div class="col-3"></div>
        </div>
      </div>
    );
  }
}
